import styled from "styled-components"
import {popularProducts} from '../data';
import Product from "./Product";

const Container = styled.div`
padding: 20px;
diplay: flex;
`

const Products = () => {
  return (
    <Container>
        {popularProducts.map(item=>(
             <Product item={item} key={item.id}/>
        ))}
    </Container>
  )
}

export default Products
